import React, {Component} from "react"
import axios from "axios"
class Filmovi extends Component{
    
    constructor(){
        super()
        this.state = {
            filmovi: []
        }
    }
    
    componentDidMount(){
        let headers=new Headers();

        headers.append('Content-Type', 'application/json');
        headers.append('Accept', 'application/json');
        headers.append("Origin","http://localhost:8080/bioskop/filmovi")

        const config={
            headers: headers
        }

        fetch('http://localhost:8080/bioskop/filmovi')
            .then(res => res.json())
            .then(response => {
                this.setState({
                    filmovi: response
            })
        })
    }

    render(){
        const prikaz=this.state.filmovi.map(f => <PrikazFilmova key={f.id} film={f} />)
        return(
            <table>
            <thead>
                <tr>
                    <th>
                        Naziv
                    </th>
                    <th>
                        Zanr
                    </th>
                    <th>
                        Trajanje
                    </th>
                    <th>
                        Distributer
                    </th>
                    <th>
                        Zemlja porekla
                    </th>
                    <th>
                        Godina proizvodnje
                    </th>
                </tr>
            </thead>
            {prikaz}
        </table>
        )
    }

}

function PrikazFilmova(props){
    return(
        <tbody>
            <tr>
                <td>{props.film.naziv}</td>
                <td>{props.film.zaanrovi}</td>
                <td>{props.film.trajanje}</td>
                <td>{props.film.distributer}</td>
                <td>{props.film.zemljaPorekla}</td>
                <td>{props.film.godinaProizvodnje}</td>
            </tr>
        </tbody>
    )
}

export default Filmovi
